package jmeter.demo;/** * @program: BeanShellDemoTwo * @description: * @author: gonghuihui * @create: 2018-08-20 16:41 **/public class BeanShellEg implements BeanUtil{    private String userName;    private String address;    public BeanShellEg(String name){        this.userName = name;    }    public BeanShellEg(String name, String address){        this.userName = name;        this.address = address;    }    public String getUserName(){        return userName;    }    public void setUserName(String username){        this.userName = username;    }    public String getAddress(){        return address;    }    public void setAddress(String address){        this.address = address;    }    public int mul(int i) {        return i * i;    }}